import React from 'react';

function TopSongs({ songs }) {
  return (
    <div className="top-songs">
      <h2>Your Top Songs</h2>
      <ul>
        {songs.map((song, index) => (
          <li key={index}>{song}</li>
        ))}
      </ul>
    </div>
  );
}

export default TopSongs;
